	public static int countSpaces(String string) {
	    int spaces = 0;
	    for(int i = 0; i < string.length(); i++) {
	        spaces += (Character.isWhitespace(string.charAt(i))) ? 1 : 0;
	    }
	    return spaces;
	}
	
